function setModel(modelName) {
  switch(modelName) {
    case "chicken":
      allCubes = Array.from(chicken);
      break;
    case "apple":
      allCubes = Array.from(apple);
      break;
    case "guy":
      allCubes = Array.from(guy);
      light = vec4(5, 6, 5, 1);
      break;
    default:
      break;
  }
  drawScene();
  drawCubes(allCubes, 1);
}
